import React from "react";

const Info = () => {
  return (
    <div>
      <img
        className="info-img"
        src="https://www.logoground.com/uploads6/dv6y2019305472019-02-113646231GURU.jpg"
        alt=""
      />
      <h3 className='info-name'>Nnam Ozioma</h3>
      <p className='info-work'>Frontend Developer</p>
      <p className='info-site'>Nnamozioma.website</p>
      <div className='info-btn'>
              <button className='btn-one'><i class="fa-solid fa-at"></i> Email</button>
              <button className='btn-two'><i class="fa-brands fa-linkedin"></i> Linkedin</button>
      </div>
    </div>
  );
};


export default Info;
